/********************************************************************
* FUNCTION y_tapi_common_init2
* 
* SIL init phase 2: non-config data structures
* Called after running config is loaded
* 
* RETURNS:
*     error status
********************************************************************/
status_t y_tapi_common_init2 (void)
{
    status_t res = NO_ERR;

    context_val = agt_init_cache(
        y_tapi_common_M_tapi_common,
        y_tapi_common_N_context,
        &res);
    if (res != NO_ERR) {
        return res;
    }

    res = u_tapi_common_init2();

    return res;
} /* y_tapi_common_init2 */

